import React from 'react';
import './App.css';
import Navbar from './components/navbar.js';
import ProductList from './components/ProductList.js';
import Footer from './components/Footer.js'

function App() {
  const ProductList=[
    {
      price:9999,
      name:'Iphone 10s max',
      quantity:0
    },
    {
      price:9999,
      name:'Redmi 10s max',
      quantity:0
    }
  ]

  return (
      <>
        <Navbar />
        <ProductList productList={productList}/>
        <Footer />
        <h1>Hello</h1>
      </>
    );
}

export default App;
